                            </table>
                        </td>
                        <HangarsBoxItem name="h6w-6" spotType="full" data={data}
                            updateData={updateData} moveMode={moveMode}
                            setMoveMode={setMoveMode} moveHere={moveHere}/>
                        <td className="empty"></td>
